<script setup>
  import { ref, reactive } from 'vue';
  import MessageLMS from '@/components/target/MessageLMS.vue'
  import MessageRCS from '@/components/target/MessageRCS.vue'
  import MessageMMS from '@/components/target/MessageMMS.vue'
  import MessagePUSH from '@/components/target/MessagePUSH.vue'

const dialogInfo = defineModel('dialogInfo', { type: Object })
const emits = defineEmits(['confirmEvent'])

  const messageLMS =  reactive({
    modify: true,
    title: ref('LMS - 신동아골프 특별회원 모집'),
    detail: ref('<신동아골프>에서 창립 20주년 기념 무기명 특별 회원 모집을 안내드립니다.'),
    message: ref('제목에 ‘특별회원’ 이라는 단어 삭제가 필요합니다. 재작성을 요청 드립니다.')
  });
  
  const messageRCS =  reactive({
    modify: true,
    title: ref('RCS - 신동아골프 특별회원 모집'),
    detail: ref('<신동아골프>에서 창립 20주년 기념 무기명 특별 회원 모집을 안내드립니다.'),
    message: ref('제목에 ‘특별회원’ 이라는 단어 삭제가 필요합니다. 재작성을 요청 드립니다.'),
  });

  const messageMMS =  reactive({
    modify: true,
    title: ref('MMS - 신동아골프 특별회원 모집'),
    src: ref('data:image/jpeg;base64,'),
    detail: ref('<신동아골프>에서 창립 20주년 기념 무기명 특별 회원 모집을 안내드립니다.'),
    message: ref('제목에 ‘특별회원’ 이라는 단어 삭제가 필요합니다. 재작성을 요청 드립니다.'),
  });

  const messagePUSH =  reactive({
    modify: true,
    title: ref('PUSH - 신동아골프 특별회원 모집'),
    alarm: ref('신동아골프 특별회원 모집'),
    file: ref('첨부한파일명.pdf'),
    url: ref('http://shinhancard.com/event/golf'),
    message: ref('제목에 ‘특별회원’ 이라는 단어 삭제가 필요합니다. 재작성을 요청 드립니다.')
  });

const data= ()=>{
      switch(dialogInfo.value.type){
        case '01' : 
        return messageLMS
        case '02' : 
        return messageRCS
        case '03' : 
        return messageMMS
        case '04' : 
        return messagePUSH
        default :
        break;
      }
    }



//확인 버튼 이벤트
const confirm = () => {
    //emit 호출
    emits('confirmEvent')
    //팝업 닫기
    dialogInfo.value.toggle = false
}

</script>

<template>
  <v-dialog
    v-model="dialogInfo.toggle"
    persistent
  >

    <!-- 결과리포트 -->
    <div class="popup-wrap large fixed" style="width:110rem">
      <div class="popup-head">
        <h3 class="h-title">광고메시지 수정</h3>
      </div>
      <div class="popup-cont">
        
        <div class="target-marketing-wrap">
          <MessageLMS v-if="dialogInfo.type == '01'" :data="data()" />
          <MessageRCS v-else-if="dialogInfo.type== '02'" :data="data()" />
          <MessageMMS v-else-if="dialogInfo.type == '03'" :data="data()" />
          <MessagePUSH v-else-if="dialogInfo.type == '04'" :data="data()" />
        </div>
        
      </div>
      <div class="popup-foot mo-show">
        <div class="btn-popwrap btn-list btm-st">
          <v-btn
            variant="flat"
            color="secondary"
            size="x-large"
            rounded="md"
            class="default"
             @click="confirm"
          >
            취소
          </v-btn>
          <v-btn
            variant="flat"
            color="primary"
            size="x-large"
            rounded="md"
            class="default"
             @click="confirm"
          >
            수정완료
          </v-btn>
        </div>
      </div>
      <v-btn class="btn-popup-close" variant="text" @click="confirm">
          <span class="sr-only">닫기</span>
      </v-btn>
    </div>
    <!-- // 결과리포트 -->
  </v-dialog>
</template>
